/* eslint-disable jsx-a11y/label-has-associated-control */
import React from 'react';

const Stocks = ({ handleChange, values }) => (
  <div>
    <label>
      <input
        className="small-input"
        type="text"
        placeholder="Stocks"
        value={values.stocks}
        onChange={handleChange('stocks')}
      />
    </label>

  </div>
);

export default Stocks;
